import { GoogleMap, MarkerF, useJsApiLoader } from '@react-google-maps/api';
import React from 'react';

const containerStyle = {
  width: '100%',
  height: '400px'
};

const center = {
    lat: 23.3441,
    lng: 85.3096
};

const center2 = {
    lat: 23.3441,
    lng: 85.3099
};



function MapComponent() {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk"
  });

  const [map, setMap] = React.useState(null);

  const onLoad = React.useCallback((map) => {
    map.setZoom(5);
    setMap(map);
  }, []);

  const onUnmount = React.useCallback((map) => {
    setMap(null);
  }, []);

  return isLoaded ? (
    <GoogleMap
      mapContainerStyle={containerStyle}
      center={center}
      zoom={10}
      onLoad={onLoad}
      onUnmount={onUnmount}
    >
      {/* Marker placed at the center location */}
      <MarkerF
        key={1}
        position={center}
        //icon={{url: logo,scaledSize:new window.google.maps.Size(80,80)}}
      />
      <MarkerF
        key={2}
        position={center2}
        //icon={{url: logo,scaledSize:new window.google.maps.Size(80,80)}}
      />
      { /* You can add more child components, such as more markers, info windows, etc. */ }
      <></>
    </GoogleMap>
  ) : <></>
}

export default MapComponent;
